using APP2024P4.Data.Entities;
using APP2024P4.Data;

namespace APP2024P4.Data;

public static class ApplicationDbContextSeeder
{
	public static void Seed(ApplicationDbContext context)
	{
		if (!context.Piezas.Any())
		{
			context.Piezas.AddRange(
				new Pieza
				{
					Nombre = "Tornillo #10",
					Precio = 10.0m,
					#region Imagen TOrnillo
					Imagen = "data:image/png;base64,",
					#endregion
					Marca = "Tanka",
					CantidadDisponible = 50
				},
				new Pieza
				{
					Nombre = "Gaurdalodo Gato",
					Precio = 2200.0m,
					#region Imagen GUARDALODO
					Imagen = "data:image/jpeg;base64,",
					#endregion
					Marca = "Gato",
					CantidadDisponible = 30
				}
			);
		}

		if (!context.Clientes.Any())
		{
			context.Clientes.AddRange(
				new Cliente
				{
					Nombre = "Margo",
				},
				new Cliente
				{
					Nombre = "Lucas",
				}
			);
		}

		// Guarda los cambios
		context.SaveChanges();
	}
}
